
export function extractPlaceholders(messageBundle){var messageMap=messageBundle.getMessageMap();var placeholders={};Object.keys(messageMap).forEach(function(msgId){placeholders[msgId]=messageMap[msgId].placeholders;});return placeholders;}
export function extractPlaceholderToIds(messageBundle){var messageMap=messageBundle.getMessageMap();var placeholderToIds={};Object.keys(messageMap).forEach(function(msgId){placeholderToIds[msgId]=messageMap[msgId].placeholderToMsgIds;});return placeholderToIds;}